import Link from 'next/link';
import {Button, ButtonToolbar} from 'react-bootstrap/Button'
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];
const list = [
  'primary',
  'secondary',
  'success',
  'danger',
  'warning',
  'info',
  'light',
  'dark',
];

const linkStyle = {
  marginRight: 15
}
const Header = () => {
  return (
    <nav>
    {services_array.map(service => (
      <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
        <a style={linkStyle}>{service}</a>
      </Link>
  ))}
      <Button variant="primary">Primary</Button>
      <Button variant="secondary">Secondary</Button>
      <Button variant="success">Success</Button>
      <Button variant="warning">Warning</Button>
      <Button variant="danger">Danger</Button>
      <Button variant="info">Info</Button>
      <Button variant="light">Light</Button>
      <Button variant="dark">Dark</Button>
      <Button variant="link">Link</Button>
  </nav>
);
}

export default Header



